import { Header } from '../../Components/Header/Header';
import './Catering.css';

function Catering()
{
   return (
    <div className='CateringHeader'>
      <Header/>
      <h1 className='CateringHeading'>CATERING FORM</h1>
      <h3>We now offer catering on our cakes and pints. If you would like to order Sweet Jesus for your next event, please fill out the form below. 2 weeks lead time required <br/> upon order confirmation.
         Provided information below, a representative will be in touch with you to discuss further details.</h3>
      <Footer/>
    </div>
   );
}

export default Catering;
